import './LogoCoin.css';
import logo from './solana-sol-logo.svg';
import { useState } from 'react';

function LogoCoin() {
    const [speed, setSpeed] = useState(3);
    return (
    <div id="logo">
        <img style={{animation: `spin ${this.state.speed}s linear infinite`}} src={logo} className="Sol-logo" height="30" width="30" alt="logo" />
    </div>
);
}

export default LogoCoin;
